return (
    <div className="random-images-container grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
      {randomImages.map((image) => (
        <div key={image.id} className="flex random-image bg-white p-4 rounded-lg shadow-md mt-2">
          <img src={image.urls.small} alt={image.alt_description} />
          <div className="image-details mt-4">
            <p className="text-sm">User: <a href={`https://www.instagram.com/${image.user.instagram_username}`} target="_blank" rel="noopener noreferrer" className="text-blue-500">{image.user.name}</a></p>
            <p className="text-sm flex items-center">
              <img src="https://img.icons8.com/?size=128&id=4T5VAk5CB92r&format=png" alt="Heart" className="w-4 h-4 text-red-500 mr-1" /> Likes: {image.likes}
            </p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default RandomImages;
